import Carousel from "react-bootstrap/Carousel";
import styled from "styled-components";

const Frame = styled.div`
  margin-top: 1rem;
  width: auto;
  height: 400px;
  background-color: black;
  display: flex;
  justify-content: center;
  align-items: center;
  color: white;
  font-size: 24px;
  font-weight: bold;
  text-align: center;
`;

const StyledDiv = styled.div`
  width: 100vw;
  height: 100vh;
  background-color: #edcac4;
`;

function HomePage() {
  return (
    <StyledDiv>
      <Carousel>
        <Carousel.Item>
          <Frame>first</Frame>
          <Carousel.Caption>
            <h3>First Slide</h3>
            <p>This is the caption for the first slide.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <Frame>second</Frame>

          <Carousel.Caption>
            <h3>Second Slide</h3>
            <p>This is the caption for the second slide.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <Frame>third</Frame>

          <Carousel.Caption>
            <h3>Third Slide</h3>
            <p>This is the caption for the third slide.</p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </StyledDiv>
  );
}

export default HomePage;
